import React from 'react';
import {connect} from 'redux-bundler-react';
import classnames from 'classnames';

class HelpButton extends React.Component{
    constructor(props){
        super(props);
    }
    render(){

        return (
            <button type="button" className="btn btn-outline-info mr-2" onClick="window.location=https://hydrologicengineeringcenter.github.io/NSI/'">
                <i className="ms ms-help" title="Get Help."></i>
            </button>
        )
    }
}
export default connect(
    HelpButton
)
